import (
	context "context"
	fern "github.com/literal/fern"
	fernclient "github.com/literal/fern/client"
)

client := fernclient.NewClient()
response, err := client.Headers.Send(
	context.TODO(),
	&fern.SendLiteralsInHeadersRequest{
		Query: "What is the weather today",
	},
)

